using SixLabors.ImageSharp;
using SixLabors.ImageSharp.Formats;
using SixLabors.ImageSharp.Metadata.Profiles.Exif;
using System;

namespace Strip_Image_Metadata
{
    class Program
    {
        static void Main(string[] args)
        {
            //Take an image and apply an orientation
            //Image bob = Image.Load(@"E:\bob2.jpg", out IImageFormat imageFormat3);
            //bob.Metadata.ExifProfile = new SixLabors.ImageSharp.Metadata.Profiles.Exif.ExifProfile();
            //bob.Metadata.ExifProfile.SetValue(ExifTag.Orientation, (ushort)8);
            //bob.Metadata.ExifProfile.SetValue(ExifTag.Copyright, "Test image");
            //bob.Save(@"e:\bob2.jpg");
            //string bob33 = bob.ToBase64String(imageFormat3);

            //Load image
            using (Image image = Image.Load(Convert.FromBase64String(@""), out IImageFormat imageFormat))
            {
                Console.WriteLine("Image before");
                Console.WriteLine($"Image Format: {imageFormat.DefaultMimeType}, medatadata total: {image.Metadata.ExifProfile?.Values?.Count}{Environment.NewLine}");

                //Replace the metadata
                image.Metadata.ExifProfile = new ExifProfile();

                //Reload the image and verify the metadata is stripped
                string cleanImage = image.ToBase64String(imageFormat);
                Image image2 = Image.Load(Convert.FromBase64String(cleanImage.Split(',')[1]), out IImageFormat imageFormat2);

                Console.WriteLine("Image after");
                Console.WriteLine($"Image Format: {imageFormat2.DefaultMimeType}, medatadata total: {image2.Metadata.ExifProfile?.Values?.Count}{Environment.NewLine}");
            }

            Console.WriteLine("Press any key to continue...");
            Console.ReadKey();
        }
    }
}
